import React from 'react';

const Cart = ({ cart, products }) => {
  return (
    <div>
      <h2>Sepet</h2>
      <ul>
        {cart.map((productId, index) => {
          const product = products.find((p) => p.id === productId);
          return (
            <li key={index}>
              {product ? `${product.name} - ${product.price}₺` : 'Ürün bulunamadı'}
            </li>
          );
        })}
      </ul>
    </div>
  );
};

export default Cart;
